content.css:
.graphistry-container {
  width: 100%;
  height: 100%;
  min-height: 20em;
  position: relative;
  box-sizing: border-box;
}
.graphistry-iframe {
  width: 100%;
  height: 100%;
  min-height: 20em;
  overflow: hidden;
  border: 0px solid #DDD;
  box-sizing: border-box;
}
.graphistry-loading-placeholder {
  width: 100%;
  height: 100%;
  overflow: hidden;
  position: absolute;
}
.graphistry-loading-placeholder-nav {
  width: 100%;
  height: 41px;
  background-color: #ffffff;
  border-bottom: 1px solid #cccccc;
}
.graphistry-loading-placeholder-content {
  width: 100%;
  height: calc(100% - 42px);
  display: table;
}
.graphistry-loading-placeholder-message {
  font-size: 12px;
  font-weight: bold;
  display: table-cell;
  vertical-align: middle;
  text-align: center;
  box-shadow: inset -4px 3px 18px 0px rgba(0, 0, 0, 0.13);
  background-image: repeating-linear-gradient(45deg, #f8f8f8, #f8f8f8 30px, #F6F6F6 30px, #F6F6F6 60px);
}
.graphistry-loading-placeholder-spinner {
  -webkit-animation: graphistry-loading-placeholder-animation-spin 400ms infinite linear;
  -o-animation: graphistry-loading-placeholder-animation-spin 400ms infinite linear;
  animation: graphistry-loading-placeholder-animation-spin 400ms infinite linear;
  width: 16px;
  height: 16px;
  box-sizing: border-box;
  border-radius: 50%;
  border: 2px solid #ccc;
  border-right-color: #333;
  display: inline-block;
  position: relative;
  vertical-align: middle;
  text-align: center;
}
@keyframes graphistry-loading-placeholder-animation-spin {
  to {
    transform: rotate(1turn);
  }
}
@-webkit-keyframes graphistry-loading-placeholder-animation-spin {
  to {
    -webkit-transform: rotate(1turn);
  }
}

p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
iframe {
  width: 100%;
  height: calc(100% - 75px);
}
.x-axis-path {
  display: none;
}
.help-link {
  position: absolute;
  top: 0px;
  /* stylelint-disable-line */
  right: 12px;
  display: block;
  width: 20px;
  height: 20px;
  border: 2px solid #80b0e0;
  border-radius: 20px;
  color: #80b0e0;
  text-align: center;
  font-size: 16px;
  line-height: 20px;
}
.help-link.hidden {
  display: none;
}
.landing-page {
  position: absolute;
  text-align: center;
  top: 12px;
  font-size: 12pt;
  right: 15px;
}
.landing-page-help-link {
  position: absolute;
  text-decoration: underline;
  top: 50px;
  font-size: 12pt;
  right: 15px;
}
